description:
Following up on his popular Cum Face Fuck Dolls, madman auteur Jake Malone delivers five distressed-damsel scenarios to set fans of extreme power-exchange sex drooling - much like hapless hitchhiker Riley Shy does after accepting a desert ride from Jake and TJ Cummings

Likewise, Isis Love and Samantha Sin discover it's not much safer hanging around that seemingly deserted warehouse - Samantha, in particular, finding herself the prize student in a BDSM master class conducted by TJ and Jake. Newcomer Charlotte Vale turns out to be an even more adept acolyte, pushing herself down the road of hole-stretching sexual endurance

Finally, Harmony goes from rich-bitch diva to slobbering, tit-fucked ass-whore in a supercharged version of the classic lady-gets-laid-by-the-gardener scenario that adds a dollop of social commentary to the fetish mix. The disc includes behind-the-scenes footage plus six Jake Malone trailers.

Cast:
Isis Love, Riley Shy, Charlotte Vale, Harmony Rose, Samantha Sin 

